var checkParallax, hideNav, init, killParallax, resized, setNav, setParallax, setScrollParams, showNav, windowWidth;

windowWidth = 0;

init = function() {
  setScrollParams();
  checkParallax();
  setNav();
  $(window).on("debouncedresize", function(event) {
    return resized();
  });
};

resized = function() {
  if ($(window).width() !== windowWidth) {
    checkParallax();
    windowWidth = $(window).width();
  }
};

checkParallax = function() {
  if (Modernizr.touch || Modernizr.mq('only screen and (max-width: 768px)')) {
    killParallax();
  } else {
    setParallax();
  }
};

setParallax = function() {
  var s;
  s = skrollr.init({
    smoothScrolling: false,
    forceHeight: false
  });
};

